import './App.css';
import {apiCall} from './api'
import 'bootstrap/dist/css/bootstrap.min.css';

import EntitysList from './components/EntitysList';

function App() {
  apiCall()
  return (
    <div className="App">
      <ListGroup>
        <ListGroup.Item active={true}>Transactions</ListGroup.Item>
        <ListGroup.Item>Customers</ListGroup.Item>
      </ListGroup>
    </div>
  );
}

export default App;
